import styled from './Cart.module.css'
import CartItem from './CartItem'
import src from '../assets/cart-jpg.png'
const Card = props =>{
    return (
        <div className={styled.cart_container}>
            <p>Your Card</p>
            <CartItem meal = {props.meal}></CartItem>
            <img src={src}/>
        </div>
    )
}
export default Card
